import Image from '../assets/avator.png';

const ImageIcon = () => {
  return (
    <IconWrapper>
      <StyledLink to="/">
        <ImageElement src={Image} alt="Icon" />
      </StyledLink>
    </IconWrapper>
  );
};

export default ImageIcon;
